import './Main.css';

class Main extends React.Component {
  render() {
    const lessonList = [
      {
        name: 'u-l',
        image: myicon,
        introduction: 'testtesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttest',
      },
      {
        name: 'u-r',
        image: myicon,
        introduction: 'testtesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttest',
      },
      {
        name: 'b-l',
        image: myicon,
        introduction: 'testtesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttest',
      },
      {
        name: 'b-r',
        image: myicon,
        introduction: 'testtesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttest',
      },
    ];

    return (
      <div className='main'>
        <div className='main-wrapper'>
          <div className='about-me-container'>
            <img scr={myicon} class="about-me-icon"/>
          </div>

          <div className='contact-container'>
            <h3>Contact</h3>
            <ContactForm />
          </div>
        </div>
      </div>
    );
  }
}

export default Main;
